const mongoose = require('mongoose')

const catagoryModel = new mongoose.Schema({
    title : {
        type : String,
        required :  true
    },
    imageUrl : {
        type : String,
        default : "data:image/jpeg;base64,"
    }
}, {timestamps : true})

const Catagory = mongoose.model("Catagory", catagoryModel)

module.exports = {
    Catagory
}